import React from 'react';
import { MultiStageFormData, MapsGeolocation } from '../../types/FormTypes';

interface Props {
  formData: MultiStageFormData;
  updateFormData: <K extends keyof MultiStageFormData>(
    section: K,
    data: Partial<MultiStageFormData[K]>
  ) => void;
  nextPage: () => void;
  previousPage: () => void;
  skipPage: () => void;
}

export default function MapsGeolocationPage({ formData, updateFormData }: Props) {
  const data = formData.mapsGeolocation;

  const handleInputChange = (field: keyof MapsGeolocation, value: string) => {
    updateFormData('mapsGeolocation', { [field]: value });
  };

  const mappingProviders = [
    'Apple Maps (iOS)',
    'Bing Maps',
    'Carto',
    'Google Maps Platform',
    'HERE Maps',
    'MapTiler',
    'Mapbox',
    'OpenStreetMap',
    'TomTom'
  ];

  return (
    <div className="space-y-8">
      <div className="text-center">
        <h2 className="text-2xl font-bold text-gray-900 mb-2">Maps & Geolocation</h2>
        <p className="text-gray-600">Choose your preferred mapping and location services</p>
      </div>

      {/* Mapping Provider */}
      <div className="bg-white p-6 rounded-lg border">
        <h3 className="text-lg font-semibold mb-4">Mapping Provider</h3>
        <p className="text-gray-600 mb-4">Select your preferred mapping and geolocation service:</p>

        <div className="space-y-3">
          {mappingProviders.map((provider) => (
            <label key={provider} className="flex items-center space-x-3 cursor-pointer">
              <input
                type="radio"
                name="mappingProvider"
                value={provider}
                checked={data.mappingProvider === provider}
                onChange={(e) => handleInputChange('mappingProvider', e.target.value)}
                className="text-blue-600 focus:ring-blue-500"
              />
              <span className="text-gray-700">{provider}</span>
            </label>
          ))}
        </div>
      </div>

      {/* Service Descriptions */}
      <div className="bg-blue-50 p-6 rounded-lg border border-blue-200">
        <h3 className="text-lg font-semibold mb-4 text-blue-900">Mapping Services Information</h3>
        <div className="space-y-4">
          <div>
            <h4 className="font-medium text-blue-800">Mapping & Geolocation Services</h4>
            <p className="text-blue-700 text-sm">Services that provide maps, geolocation, routing, and location-based features for your application. These services offer APIs for embedding maps, getting user location, calculating routes, and implementing location-based functionality.</p>
          </div>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4 mt-4">
            <div>
              <h5 className="font-medium text-blue-800">Popular Options:</h5>
              <ul className="text-blue-700 text-sm space-y-1 mt-2">
                <li>• <strong>Google Maps Platform:</strong> Comprehensive mapping with extensive APIs</li>
                <li>• <strong>Mapbox:</strong> Customizable maps with powerful styling options</li>
                <li>• <strong>OpenStreetMap:</strong> Free, open-source mapping data</li>
              </ul>
            </div>
            <div>
              <h5 className="font-medium text-blue-800">Features Available:</h5>
              <ul className="text-blue-700 text-sm space-y-1 mt-2">
                <li>• Interactive maps and navigation</li>
                <li>• Geolocation and reverse geocoding</li>
                <li>• Route planning and directions</li>
                <li>• Location-based services</li>
              </ul>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
